o link any other website or External Sites to the Website without our express prior written consent and approval. External Sites may send their own cookies to you or otherwise collect data or solicit personal information and you are responsible for checking the External Sites to locate and review its terms and conditions and privacy policy and you hereby acknowledge that you access, browse, link and\/or bookmark the External Sites at your own risk.","title14":"12. Termination:","paragraph15":"We may issue a warning, temporarily suspend, permanently suspend or terminate your right to use this website if you:\\n  12.1 Substantially breach any of these Terms and Conditions;\\n  12.2 Infringe or violate or attempt to infringe or violate any rights of any other user(s) of this website and\/or third parties in connection with this website; or\\n   12.3 If you are using this website to commit or attempt to commit any crime.\\n  12.4 Misusing or any illegal attempt to hack any part of Blinx.","title15":"13. Governing Law and Jurisdiction:","paragraph16":"The Terms and Conditions apply to your use of the Website and are compliant with the applicable laws of [British Virgin Islands]. By using the Website, you expressly consent and agree to the governing law and jurisdiction of [British Virgin Islands] over the terms of use and any dispute over the content of the Website shall be subject to the exclusive jurisdiction of the courts of the respective jurisdiction mentioned above, irrespective of your geographical location.","title16":"14. Adjustment:","paragraph17":"14.1 'we' reserve the right to change the terms and conditions at any time. Any of these changes are considered effective on the day when posting on the 'Blinx' website, you must carefully read the terms before using 'Blinx' when registering an account or using the 'services' and every time you use 'www.blinx.com', We recommend that you print a copy for future reference.\\n 14.2 Your continued use of 'Blinx' after pu